import React from 'react'
import { useFetch } from './components/hooks/useFetch'
import './styles/settings.scss'


export const MainApp = () => {
    const state = useFetch()
    console.log(state);

    return (
        <div>
            <h1>Main app</h1>
            {
                state.map(item => (
                    <div key = {item.id}>
                        <h1>{item.name}</h1>
                        <p>{item.summary}</p>

                    </div>
                ))
            }


            
        </div>
    )
}
